class B1_Tbu_Analog extends ConsumerStatefulWidget {
  const B1_Tbu_Analog({super.key});

  @override
  ConsumerState<B1_Tbu_Analog> createState() => _B1_Tbu_AnalogState();
}

class _B1_Tbu_AnalogState extends ConsumerState<B1_Tbu_Analog>
    with SingleTickerProviderStateMixin {
  late AnimationController _controller;

  double knobValue1 = -135;
  double knobValue2 = -135;

  @override
  void initState() {
    super.initState();
    control = Control.playFromStart;
    _controller =
        AnimationController(vsync: this, duration: const Duration(seconds: 3));
    _updateTween();
  }

  late MovieTween tween;
  late Control control;

  void _updateTween() {
    // final isStateTrue =
    //     ref.read(mapListProvider)[0]["steps"][0]["steps"][0]["state"];

    // Update the knob values based on the state

    tween = MovieTween()
      ..scene(
              begin: const Duration(seconds: 0),
              end: const Duration(seconds: 3))
          .tween('needle', Tween<double>(begin: knobValue1, end: knobValue2));
    _controller.reset();
    _controller.forward();
    print(knobValue1);
    print(knobValue2);
  }

  @override
  void dispose() {
    _controller.dispose();
    super.dispose();
  }

  @override
  Widget build(BuildContext context) {
    ref.listen<bool>(
        mapListProvider
            .select((state) => state[2]["steps"][0]["steps"][22]["state"]),
        (previous, next) {
      if (next) {
       
        setState(() {
          knobValue1 = -135;
          knobValue2 = -110;
          print(
              "state============> ${ref.read(mapListProvider)[2]["steps"][0]["steps"][22]["state"]}");
          _updateTween();
        }); 
      }
    });

    ref.listen<bool>(
        mapListProvider
            .select((state) => state[2]["steps"][1]["steps"][7]["state"]),
        (previous, next) {
      if (next) {
        setState(() {
          knobValue1 = -110;
          knobValue2 = -103;
          print(
              "state============> ${ref.read(mapListProvider)[2]["steps"][0]["steps"][22]["state"]}");
          _updateTween();
        }); 
      }
    });
